<!doctype html>
<html>
    <head>
        <meta charset="utf-8">
        <meta http-equiv="x-ua-compatible" content="ie=edge">
        <title>Viveka</title>
        <meta name="description" content="Viveka">
        <meta name="viewport" content="width=device-width, initial-scale=1">
        <link href='http://fonts.googleapis.com/css?family=Source+Sans+Pro:400,700' rel='stylesheet' type='text/css'>
        <link rel="stylesheet" href="main.css">
    </head>
    <body>
        <div class="request get">
            <span class="url">/tests</span>
            <div class="content"></div>
        </div>
        <div class="request post missing">
            <span class="url">/tests</span>
            <div class="content"></div>
        </div>
        <div class="request get missing">
            <span class="url">/tests/{testId}</span>
            <div class="content"></div>
        </div>
        <div class="request delete missing">
            <span class="url">/tests/{testId}</span>
            <div class="content"></div>
        </div>
        <div class="request put missing">
            <span class="url">/tests/{testId}</span>
            <div class="content"></div>
        </div>
        <div class="request get missing">
            <span class="url">/tests/{testId}/fingerprints</span>
            <div class="content"></div>
        </div>
        <div class="request post missing">
            <span class="url">/tests/{testId}/fingerprints</span>
            <div class="content"></div>
        </div>
        <div class="request get missing">
            <span class="url">/fingerprints/{fingerPrintId}</span>
            <div class="content"></div>
        </div>
        <div class="request get missing">
            <span class="url">/differences/{differenceId}</span>
            <div class="content"></div>
        </div>
        <div class="request get missing">
            <span class="url">/differences/{baselineFingerPrintId}/{targetFingerPrintId}</span>
            <div class="content"></div>
        </div>
        <script src="http://code.jquery.com/jquery-1.11.3.min.js"></script>
        <script src="index.js"></script>
    </body>
</html>
